import React from'react';
import './Field.css'





const Field= () => {
    return(
            <form className='form'>
                <label for="email" className='form-label' placeholder=''>E-Mail</label>
                <input type="email" name="email" className='form-input'  placeholder='Enter your E-Mail' />
                
            </form>
    );
}

export default Field;
